import React, {useEffect} from "react";
import {Container, Heading} from "@chakra-ui/react";

interface test{
    name: string;
}

function LiveMatches(){
    useEffect(() => {
        const fetching = async () => {
            const url = 'https://livescore6.p.rapidapi.com/matches/v2/list-live?Category=soccer&Timezone=-7';
            const options = {
                method: 'GET',
                headers: {
                    'X-RapidAPI-Key': 'cf2e5b804emshefb82ef54fec80dp109415jsne25f7e2abcca',
                    'X-RapidAPI-Host': 'livescore6.p.rapidapi.com'
                }
            };

            try {
                const response = await fetch(url, options);
                const result = await response.text();
                console.log(result);
            } catch (error) {
                console.error(error);
            }
        }

        fetching()
    }, []);

    return (
        <Container alignItems='center' bg='#030303' minW='max-content' mt='60px'>
    <Heading bg='#030303' color='#7b7b7b' size='lg' textAlign='center'>
        Live Matches
    </Heading>
        </Container>
    )
}

export default LiveMatches

